textOriginal:
Bolsonaro não é o melhor do mundo, mas contra o Lula ele se torna literalmente o salvador da pátria contra esse socialismo mascarado de Lula. Vencendo as eleições com uma bancada em maioria alinhada com seus pensamentos, a chance do Brasil melhorar é grande. 

Só pra não esquecer: 

- socialismo nunca deu certo em lugar nenhum;
- comunistas e nazistas são igualmente repugnantes;
- a melhor forma de governo para o país é a monarquia;
- Dom Pedro II é o maior brasileiro e líder que esse país já teve;
- Lula não é inocente. 

Abraços!
